let labels = ["date", "temperature"];
let data = [];


var myArray = msg.payload

/**
* @param {any[]} item
* @param {any} index
*/

for (let index = 0; index < myArray.length; ++index) {
    const timestamp = myArray[index].payload.Date;
    const temp = myArray[index].payload.Temperature;
    const foo = { "x": timestamp, "y": temp }
    data.push(foo);
}

msg.payload = [{
    "series": ["My Data"],
    "data": [data],
    "labels": labels
}];

return msg;

